import React, { useState } from "react";
import {
  IonBackButton,
  IonButtons,
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
} from "@ionic/react";

import MultiForm from "../../components/MultiForm/MultiForm";
import { useParams } from "react-router";

const [agent, setAgent] = useState(
  {
    agentId: "",
    complexName: "",
    contractId: "",
    name: "",
    surname: "",
    id: "",
    cellNum: "",
    street1: "",
    street2: "",
    city: "",
    province: "",
    postalCode: "",
    password: "",
  },
);
const [complex, setComplex] = useState(
  {
    complexId: "",
    name: "",
    street1: "",
    street2: "",
    city: "",
    province: "",
    postalCode: "",
    telephoneNum: "",
    startTime: "",
    endTime: "",
    cellNum: "",
    units: [],
    agents: [],
  },
);
const [pack, setPack] = useState(
  {
    packageId: "",
    promotionId: "",
    packageName: "",
    minutes: 0,
    standardPrice: "",
    suvPrice: "",
    description: "",
    onPromotion: false,
  },
);
const [promotion, setPromotions] = useState(
  {
    promotionId: "",
    promotionName: "",
    packageName: "",
    standardPrice: "",
    suvPrice: "",
    isEnabled: false,
  },
);

const AddAgent: React.FC = () => {
  const {name, title} = useParams<{name: string, title: "agent" | "complex" | "package" | "promotion" }>();
  const backUrl = "/page/";
  let content;
  if (title === "agent"){
    content = agent;
  }
  else if (title === "complex"){
    content = complex;
  }
  else if (title === "package"){
    content = agent;
  }else{
    content = promotion
  }
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton defaultHref={backUrl.concat(name).concat("/").concat(title)} />
          </IonButtons>
          <IonTitle>Add {name}</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <MultiForm buttonName="Add" type={title} isDisabled={false} content={content}/>
      </IonContent>
    </IonPage>
  );
};

export default AddAgent;
